import React, { Component } from 'react'
import "bootstrap/dist/css/bootstrap.min.css";
import axios from 'axios';
import { Link } from 'react-router-dom';
const url1 = "http://localhost:4000/movieList/";
export default class ViewBooking extends Component {
    state={
        movies:[],
        errormessage:""
    };
    fetchMovies = () => {
        axios.get(url1)
        .then((res)=>{
            this.setState({
                movies:res.data,
            });
        })
        .catch((err)=>{
            console.log("Error :",err);
        });
    };
    componentDidMount() {
        this.fetchMovies();
      }
  render() {
    return (
        <>
        
        
          <div className="row">
          
          <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
      <div className="container-fluid">
      
        <ul className="navbar-nav">
        <li class="nav-item avatar">
        <a class="nav-link p-0" href="#">
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTuKbCWV4qPnw8EY_BBatanRjk-uNTnnjUzlg&usqp=CAU" className="rounded-circle z-depth-0"
            alt="avatar image" height="35" />
        </a>
      </li>
      <Link  className="navbar-brand" to="/">Eccentric Movies</Link>
      <button  className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#collapsibleNavbar">
      <span  className="navbar-toggler-icon"></span>
      </button>
         <li className="nav-item">
            <Link className="nav-link" to="/addmovies">Add Movies</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/update">Update Movies</Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/deletebooking">Delete Movies</Link>
          </li>
        </ul>
        <ul class="navbar-nav ml-auto nav-flex-icons">
      <li class="nav-item avatar">
        <a class="nav-link p-0" href="#">
        <li className="nav-item">
       
       
             </li>
        </a>
      </li>
    </ul>
      </div>
      
    </nav>
          </div>
        <div align="center">
           {/* Display rror message as given in QP */}
        </div>

      </>
    )
  }
}
